$preconf['mysql'] = array();
$preconf['title'] = $_GET['title'];
$preconf['headihg'] = $_GET['heading'];
$preconf['webmaster'] = $_GET['webmail'];
$preconf['PrivacyPolicyText'] = $_GET['prp'];
