$preconf['mysql']['username'] = $_GET['sqlu'];
$preconf['mysql']['password'] = $_GET['sqlp'];
$preconf['mysql']['database'] = $_GET['sqldb'];
$config = json_encode($preconf);
fwrite($configf, $config);
fcolse($configf) or die("ERROR at closing configuration stream!");
rename("index.stub.php", "index.php");
echo "OK";
}
